import React from 'react';
import styles from './Navb.module.css';
import { FaInstagram, FaGithub, FaLinkedin } from "react-icons/fa";
import { Navbar, Nav } from 'react-bootstrap';

function Navb() {
    return (
        <Navbar className={styles.Navb} expand="lg">
            <Nav className="mr-auto">
                <Nav.Link href="#">Apresentação</Nav.Link>
                <Nav.Link href="#">Habilidades</Nav.Link>
                <Nav.Link href="#">Projetos</Nav.Link>
            </Nav>
            <Nav>
                <Nav.Link href="#"><FaInstagram size={30} /></Nav.Link>
                <Nav.Link href="#"><FaGithub size={30} /></Nav.Link>
                <Nav.Link href="#"><FaLinkedin size={30} /></Nav.Link>
            </Nav>
        </Navbar>
    );
}

export default Navb;
